import React from 'react';
import '../styles/index.css';

const AnimationBody = () => {
  return (
    <div className="banner-images-container">
      <div className="banner-image">
        <img src="./assets/human-body-frontal.png" alt="Image 1" className="image-front" />
        <img src="./assets/human-body.png" alt="Image 2" className="image-back" />
      </div>
    </div>
  );
};

export default AnimationBody;
